        DB::statement("INSERT INTO `inspires` (`id`, `data`, `created_at`, `updated_at`) VALUES
        (1, 'La inteligencia consiste no sólo en el conocimiento, sino también en la destreza de aplicar los conocimientos en la práctica. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (2, 'La verdadera sabiduría está en reconocer la propia ignorancia. (Sócrates)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (3, 'La libertad está en ser dueños de la propia vida. (Platón)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (4, 'Una verdad perjudicial es mejor que una mentira útil. (Mann)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (5, 'Considero más valiente al que conquista sus deseos, que al que conquista a sus enemigos, ya que la victoria más dura es la victoria sobre uno mismo. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (6, '¿Me preguntas por qué compro arroz y flores? Compro arroz para vivir y flores para tener algo por lo que vivir. (Confucio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (7, 'La cosa más difícil es conocernos a nosotros mismos; la más fácil es hablar mal de los demás. (Tales de Mileto)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (8, 'No juzgamos a las personas que amamos. (Jean-Paul Sartre)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (9, 'No dejes crecer la hierba en el camino de la amistad. (Sócrates)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (10, 'Nadie es feliz durante toda su vida. (Eurípides)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (11, 'Estar inactivo es el camino corto hacia la muerte, ser diligente es una forma de vida; la gente tonta está inactiva, los sabios son diligentes. (Buda)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (12, 'El maestro es la síntesis justa de disposición natural y ejercicio constante. (Protágoras)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (13, 'Los educados se diferencian de los no educados tanto como los vivos de los muertos. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (14, 'La paciencia es amarga, pero su fruto es dulce. (Jean-Jacques Rousseau)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (15, 'Solo los cobardes son valientes con las mujeres. (Julio César)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (16, 'Si el alma es de inmortal naturaleza, si al nacer en el cuerpo se insinúa, ¿Cómo es que no podemos acordarnos de la vida pasada, ni tenemos de los antiguos hechos resto alguno? (Lucrecio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (17, 'Adquirimos la costumbre de vivir antes que la de pensar. (Albert Camus)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (18, 'Solamente aquel que construye el futuro tiene derecho a juzgar el pasado. (Friedrich Nietzsche)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (19, 'Felicidad no es hacer lo que uno quiere sino querer lo que uno hace. (Jean Paul Sartre)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (20, 'Los hombres olvidan siempre que la felicidad humana es una disposición de la mente y no una condición de las circunstancias. (John Locke)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (21, 'Algunas personas hacen que las cosas sucedan. Algunas personas ven que las cosas pasan. Y luego están los que se preguntan: \'¿Qué demonios acaba de pasar?’ (Carroll Bryant)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (22, 'El mundo se fundamenta en los Estados; los Estados, en las familias; y las familias, en las personas. (Mencio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (23, 'Lo poco que sé se lo debo a mi ignorancia. (Platón)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (24, 'Algunos creen que para ser amigos basta con querer, como si para estar sano bastara con desear la salud. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (25, 'Vivimos en el mejor de los mundos posibles. (Gottfried Wilhelm Leibniz)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (26, 'Ser es ser percibido. (George Berkeley)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (27, 'Toda la historia de la sociedad humana, hasta la actualidad, es una historia de lucha de clases. (Karl Marx)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (28, 'Lo más sabio es el tiempo, porque esclarece todo. (Tales de Mileto)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (29, 'La esperanza es el peor de los males, pues prolonga el tormento del hombre. (Friederich Nietzsche)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (30, 'La ignorancia es la noche de la mente: pero una noche sin luna y sin estrellas. (Confucio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (31, 'Sólo en soledad se siente la sed de verdad. (María Zambrano)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (32, 'Una mala paz es siempre mejor que la mejor de las guerras. (Marco Tulio Cicerón)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (33, 'Podemos imaginarlo todo, predecirlo todo, salvo hasta dónde podemos hundirnos. (E. Cioran)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (34, 'El que se conoce a sí mismo conoce el ser del Universo. (Enseñanzas de los Upanishads)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (35, 'El amor inmaduro dice: “te amo porque te necesito”. El maduro dice: “te necesito porque te amo”. (Erich Fromm)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (36, 'La base de todo Estado es la educación de sus jóvenes. (Diógenes)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (37, 'Pocas veces pensamos en lo que tenemos; pero siempre en lo que nos falta. (Arthur Schopenhauer)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (38, 'La felicidad está en la libertad, y la libertad en el coraje. (Pericles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (39, 'Hay hombres que trabajan como si fueran a vivir eternamente. (Demócrito)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (40, 'El gran talento procede, más que de los elementos intelectuales y de un refinamiento social superior al de los demás, de la facultad de transmitirlos, de invertirlos. (Proust)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (41, 'Todos los grandes acontecimientos tienen lugar en nuestra mente. (Oscar Wilde)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (42, 'El ocio es la madre de la filosofía. (Thomas Hobbes)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (43, 'Todo el mundo ve lo que aparentas ser, pocos experimentan lo que realmente eres. (Nicolás Maquiavelo)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (44, 'Ama y haz lo que quieras. Si callas, callarás con amor; si gritas, gritarás con amor; si corriges, corregirás con amor, si perdonas, perdonarás con amor. (San Agustín de Hipona)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (45, 'El tiempo es un gran velo suspendido delante de la eternidad como para ocultárnosla. (Tertuliano)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (46, 'La vida sólo puede ser comprendida hacia atrás, pero únicamente puede ser vivida hacia delante. (Sören Kierkegaard)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (47, 'Enamorarse es sentirse encantado por algo, y algo sólo puede encantar si es o parece ser perfección. (José Ortega y Gasset)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (48, 'El sabio no pretende nada: ni ser bueno, ni ser fuerte, ni ser dócil, ni ser rebelde, ni ser contradictorio, ni ser coherente… sólo quiere ser. (Jorge Bucay)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (49, 'Una verdad que se dice con mala intención. Supera todas las mentiras que puedas inventar. (William Blake)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (50, 'Amar profundamente a alguien nos da fuerza. Sentirse amado profundamente por alguien nos da valor. (Lao Tsé)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (51, 'Toda la vida se sustenta mutuamente. Dentro de tí está la salvación. (Mahavira)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (52, '¿Por qué buscáis la felicidad, ¡oh mortales, fuera de vosotros, cuando la tenéis dentro de vosotros mismos? (Boecio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (53, 'Y por encima de todo esto, revestíos del amor, que es el vínculo de la perfección. (Pablo de Tarso)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (54, 'Cada persona toma los límites de su propio campo de visión para los límites del mundo. (Arthur Schopenhauer)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (55, 'La belleza en las cosas existe en la mente que las contempla. (David Hume)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (56, 'Puedo controlar mis pasiones y emociones si puedo entender su naturaleza. (Baruch Spinoza)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (57, 'Cuanto más grande es la dificultad, más gloria hay en superarla. (Epicuro)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (58, 'En tres tiempos se divide la vida: en presente, pasado y futuro. De éstos, el presente es brevísimo; el futuro, dudoso; el pasado, cierto. (Séneca)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (59, 'La mayor sabiduría que existe es conocerse a uno mismo. (Galileo Galilei)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (60, 'Los jóvenes de hoy no parecen tener respeto alguno por el pasado ni esperanza alguna para el porvenir. (Hipócrates)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (61, 'Escucha, serás sabio. El comienzo de la sabiduría es el silencio. (Pitágoras)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (62, 'Nuestras convicciones más arraigadas, más indubitables, son las más sospechosas. Ellas constituyen nuestro límite, nuestros confines, nuestra prisión. (José Ortega y Gasset)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (63, 'Tiene más el que está más contento con menos. (Diógenes)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (64, 'La curiosidad es la lujuria de la mente. (Thomas Hobbes)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (65, 'Es un principio indiscutible que para saber mandar bien, es preciso saber obedecer. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (66, 'Si en medio de las adversidades persevera el corazón con serenidad, con gozo y con paz, esto es amor. (Santa Teresa de Jesús)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (67, 'Filosofía es la búsqueda de la verdad como medida de lo que el hombre debe hacer y como norma para su conducta. (Sócrates)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (68, 'No lastimes a los demás con lo que te causa dolor a ti mismo. (Buda)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (69, 'pechosas, y normalmente se rechazan, sin más razón que el hecho de no ser comunes. (J. Locke)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (70, 'El problema de la mujer siempre ha sido un problema de hombres. (Simone de Beauvoir)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (71, 'El propósito de la educación es mostrar a la gente cómo aprender por sí mismos. El otro concepto de la educación es el adoctrinamiento. (Noam Chomsky)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (72, 'El silencio es el único amigo que jamás traiciona. (Confucio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (73, 'En el amor siempre hay algo de locura. En la locura siempre hay algo de razón. (Friederich Nietzsche)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (74, 'Estoy en desacuerdo con lo que dices, pero defenderé hasta la muerte tu derecho a decirlo. (Evelyn Beatrice Hall)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (75, 'Ante todo debéis guardaros de las sospechas, porque ése es el veneno de la amistad. (San Agustín de Hipona)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (76, 'Los principales elementos que integran una vida satisfecha son dos: la tranquilidad y el estímulo ( John Stuart Mill)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (77, 'La felicidad no es un ideal de la razón sino de la imaginación. (Immanuel Kant)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (78, '¡Dios está muerto! ¡Sigue muerto! Y lo hemos matado entre todos. (Friedrich Nietzsche)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (79, 'Somos lo que hacemos día a día. De modo que la excelencia no es un acto sino un hábito. (Aristóteles)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (80, 'Los sabios hablan porque tienen algo que decir, los tontos hablan porque tienen que decir algo. (Platón)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (81, 'Del todo nace el uno, y del uno nace el todo. (Heráclito)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (82, 'Justicia sin misericordia es crueldad. (Tomás de Aquino)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (83, 'La felicidad es un artículo maravilloso: cuanto más se da, más le queda a uno. (Blaise Pascal)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (84, 'No existen pensamientos malvados, excepto uno: el negarse a pensar. (Ayn Rand)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (85, 'No siempre podemos agradar, pero siempre podemos tratar de ser agradables. (Voltaire)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (86, 'Cuando un hombre piensa a lo grande, se equivoca a lo grande. (Martin Heidegger)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (87, 'Quien se enfada por las críticas, reconoce que las tenía merecidas. (Tácito)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (88, 'Olvidemos lo que ya sucedió, pues puede lamentarse, pero no rehacerse. (Tito Livio)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (89, 'Nunca moriría por mis creencias, porque podría estar equivocado. (Bertrand Russell)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (90, 'Lo que te preocupa te domina. (John Locke)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (91, 'Es propio de las censuras acreditar las opiniones que atacan. (Voltaire)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (92, 'La ciencia no es solamente compatible con la espiritualidad, sino que es una profunda fuente de espiritualidad. (Carl Sagan)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (93, 'La mayor declaración de amor es la que no se hace; el hombre que siente mucho, habla poco. (Platón)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (94, 'Un verdadero amigo es el que llega cuando todos se han ido. (Albert Camus)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (95, 'El conocimiento es poder. (Francis Bacon)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (96, 'No puedo enseñar nada a nadie. Solo puedo hacerles pensar. (Sócrates)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (97, 'Lo más difícil de aprender en la vida es qué puente hay que cruzar y qué puente hay que quemar. (B. Russell)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (98, 'Antes de convencer al intelecto, es imprescindible tocar y predisponer el corazón. (Blaise Pascal)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (99, 'Si me engañas una vez, tuya es la culpa; si me engañas dos, es mía. (Anaxágoras)', '2023-09-21 06:50:25', '2023-09-21 06:50:25'),
        (100, 'La fuerza y la mente son opuestos. La moralidad termina donde empieza la pistola. (Ayn Rand)', '2023-09-21 06:50:25', '2023-09-21 06:50:25')");

